var leaderboard = {};

function resultados() {
	let resultString = "RESULTADOS!:\n";
	let bestTimes = {};

	// Obtener el mejor tiempo de cada jugador
	for (const [name, laps] of Object.entries(leaderboard)) {
		let bestTime = Infinity;
		for (const [lap, time] of Object.entries(laps)) {
			if (parseFloat(time) < bestTime) {
				bestTime = parseFloat(time);
			}
		}
		bestTimes[name] = bestTime;
	}

	// Ordenar los mejores tiempos de manera ascendente
	const sortedBestTimes = Object.entries(bestTimes).sort((a, b) => a[1] - b[1]);

	// Construir la tabla de resultados
	sortedBestTimes.forEach((entry, index) => {
		resultString += `${index + 1} - ${entry[0]}: ${entry[1].toFixed(3)}\n`;
	});

	return resultString;
}

function sendLapTime(name, time, lap) {
    // Verificar si el piloto ya tiene tiempos registrados
    if (leaderboard.hasOwnProperty(name)) {
        // Verificar si el tiempo ya existe en la lista de tiempos del piloto para la vuelta específica
        if (!leaderboard[name][lap] || parseFloat(time) < parseFloat(leaderboard[name][lap])) {
            // Agregar o reemplazar el nuevo tiempo en la lista
            leaderboard[name][lap] = time;
        }
    } else {
        // Si el piloto no tiene tiempos registrados aún, creamos una nueva entrada en el objeto
        leaderboard[name] = {};
        leaderboard[name][lap] = time;
    }
}

